import React, {Component} from 'react';


class Header extends Component {

    constructor(props) {
        super(props);
        this.state = {
            time: new Date().toTimeString()
        }
    }


    render() {
        return <header>a header with timeString: {this.state.time}</header>
    }
}


export default Header;
